public class Solution {
    public long MinSum(int[] nums1, int[] nums2) {
        long sum1 = 0, sum2 = 0;
        int zeros1 = 0, zeros2 = 0;
        foreach (int num in nums1) {
            if (num == 0) zeros1++;
            sum1 += num;
        }
        foreach (int num in nums2) {
            if (num == 0) zeros2++;
            sum2 += num;
        }

        if (zeros1 == 0 && zeros2 == 0) {
            return sum1 == sum2 ? sum1 : -1;
        }

        if ((zeros1 == 0 || zeros2 == 0) && sum1 != sum2) {
            return -1;
        }

        long diff = Math.Abs(sum1 - sum2);
        if (diff % Math.Abs(zeros1 - zeros2) != 0) {
            return -1;
        }

        long minValue = diff / Math.Abs(zeros1 - zeros2) + 1;
        long finalSum = Math.Max(sum1, sum2) + minValue * Math.Max(zeros1, zeros2);
        return finalSum;
    }
}
